(function() {
	if (sessionStorage['midiB64']) return

	document.querySelector('#controls').innerHTML = '<button id="loadDemoFile">‚≠ê Show demo song</button>'
	document.querySelector('#loadDemoFile').addEventListener('click', (e) => {
		let config = {
			barSubdivisions: 4,
			barsPerRow: 4,
			lineHeight: 10,
			removeShorterThan: 4,
			rowSpacing: 64,
			splitSVGs: true,
			staggered: true,
			timeDivision: 240,
			title: "Theme Hospital - 6s & 7s",
			tracksToRender: { 0: true, 3: true },
			trackOptions: { 3: { transpose: 12, style: 'leftHanded' } },
			trimEnd: 32,
			trimStart: null,
			width: 960,
		}
		sessionStorage['filename'] = '6s & 7s.mid'
		sessionStorage['midiB64'] = ''

		loadMIDI(sessionStorage['midiB64'], sessionStorage['filename'], config)
		e.preventDefault()
	})
})()